/* eslint-disable */
/* tslint:disable */
// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmDailymotion,
  VmEmbed 
} from '@vime/core';

import { define } from '../lib';


define('vm-dailymotion', VmDailymotion);
define('vm-embed', VmEmbed);


export interface DailymotionProps extends JSX.VmDailymotion, HTMLAttributes<HTMLVmDailymotionElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmDailymotionElement, DailymotionProps>(
  'vm-dailymotion',
  new Set(['videoId','shouldAutoplayQueue','showUpNextQueue','showShareButtons','color','syndication','showDailymotionLogo','showVideoInfo','language','autoplay','controls','poster','logger','loop','muted','playsinline']),
);
